```java
void bulletCreate()
{
  if (mousePressed && bulletCounter <= 0)
  {
    bulletArray.add(new bullet(int(playerShip.x + PLAYERWIDTH/2 - BULLETWIDTH), int(playerShip.y), bullet));
    bulletCounter++;
  } else if (mousePressed && bulletCounter > 0)
  {
    if (mousePressed && bulletArray.get(bulletCounter - bulletMode).y < playerShip.firerate)
    {
      if (playerShip.doubleBullets == false && playerShip.tripleBullets == false)
      {
        bulletArray.add(new bullet(int(playerShip.x + PLAYERWIDTH/2 - BULLETWIDTH), int(playerShip.y), bullet));
        bulletCounter++;
        bulletMode = 1;
      } else if (playerShip.doubleBullets == true && playerShip.tripleBullets == false)
      {
        for (int i = 0; i < 2; i++)
          bulletArray.add(new bullet(int(playerShip.x + PLAYERWIDTH/5 + i*(PLAYERWIDTH/2)), int(playerShip.y), bullet));
        bulletCounter = bulletCounter + 2;
        bulletMode = 2;
      } else if (playerShip.tripleBullets == true)
      {
        for (int i = 0; i < 3; i++)
          bulletArray.add(new bullet(int(playerShip.x + PLAYERWIDTH/4 + i*(PLAYERWIDTH/5)), int(playerShip.y), bullet));
        bulletCounter = bulletCounter + 3;
        bulletMode = 3;
      }
    }
  }
}```

